This model complies with NIJ Standard-0101.06 for Ballistic Resistance of Body Armor.
Will defeat multiple hits from 7.62x51 (.308), 7.62x39, even 5.56 AP rounds and any other smaller rifle/pistol rounds. Also will stop 12 gauge slugs.
This is curved hardened steel sized XL 11X14 and will fit in vest plate carriers that use the smaller 10x13 plates
This is new. Picture shows 2, but one already sold so selling the last one. Not looking to ship it so please FTF.

